import React, { useState } from "react";

const time = new Date();
time.toDateString();

const App = () => {
    const [count, setCount] = useState(time) 
    const inc = () => {
        setCount(count + 10)
    }
    const dec = () => {
        setCount(count - 1)
    }
    return(
        <>
            <h1>{count}</h1>
            <button onClick={inc}> Get Time </button> 
        </>
    )
}

export default App;
